import Navbar from "../Navbar";
import Footer from "../Footer";
import globalStyles from "../../styles/global";

import { Container } from "./styles";
const Layout = props => (
  <>
    <Container>
      <Navbar />
      <div className="content">{props.children}</div>
      <Footer />
    </Container>
    {globalStyles}
  </>
);

export default Layout;
